import * as types from "../actions/actionTypes";

const INTIAL_STATE = {
    folders: [],
    loading: false,
};

export const signInReducers = (state = INTIAL_STATE, action) => {
    switch(action.type) {
        case types.INIT_GOOGLE_SIGNIN:
            return Object.assign({}, state, {
              })
            break;
        case types.START_GOOGLE_SIGNIN:
            return Object.assign({}, state, {
                auth: action.auth
            })
            break;
        case types.SUCCESS_GOOGLE_SIGNIN:
            break;
        case types.FAILED_GOOGLE_SIGNIN:
            break;
    }
}

export const filesDashboardReducers = (state = INTIAL_STATE, action) => {
    switch(action.type) {
        case types.GET_FILES:
            return Object.assign({}, state, {
                loading: true,
              })
        default:
            return state;
    }
}
